import React from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import {Grid,Accordion,Typography,Paper,Box,Link,Checkbox,TextField,Button,FormControlLabel,AccordionSummary} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Logo from './assets/images/imagen_reportes.png';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const useStyles = makeStyles((theme) => ({
  root: {
    height: '100vh',
  },
  image: {
    backgroundImage: `url(${Logo})`,
    backgroundRepeat: 'no-repeat',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[20] : theme.palette.grey[700],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
  heading: {
    fontSize: theme.typography.pxToRem(15),
    flexBasis: '33.33%',
    flexShrink: 0,
  }
}));

export default function App() {
  const classes = useStyles();
  const [expanded, setExpanded] = React.useState(true);

  const handleChange = (panel) => (event, isExpanded) => {
    setExpanded(isExpanded ? panel : false);
  };
  return (
    <Grid container component="main" className={classes.root}>
      <CssBaseline />
      <Grid item xs={false} sm={4} md={5} className={classes.image} />
      <Grid item xs={12} sm={8} md={7} component={Paper} elevation={6} square>
        <div className={classes.paper}>

          <Typography component="h1" variant="h5">
           Formulario para sacar reportes
          </Typography>
          <form className={classes.form} noValidate>
		  <Accordion expanded={expanded === 'paciente'} onChange={handleChange('paciente')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="pacientebh-content"
				id="pacientebh-header"
			>
          <Typography className={classes.heading}>Paciente</Typography>

        </AccordionSummary>
			<TextField
				variant="outlined"
				margin="normal"
				required
				fullWidth
				id="email"
				label="Email Address"
				name="email"
				autoComplete="email"
				autoFocus
				/>
		  </Accordion>
		  <Accordion expanded={expanded === 'antecedentes'} onChange={handleChange('antecedentes')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="antecedentesbh-content"
				id="antecedentesbh-header"
			>
          <Typography className={classes.heading}>Antecedentes</Typography>

       		 </AccordionSummary>
			<FormControlLabel
				control={<Checkbox value="remember" color="primary" />}
				label="Remember me"
				/>
		  </Accordion>
		  <Accordion expanded={expanded === 'factores_de_riesgo'} onChange={handleChange('factores_de_riesgo')}> 
			<AccordionSummary
				expandIcon={<ExpandMoreIcon />}
				aria-controls="factores_de_riesgobh-content"
				id="factores_de_riesgobh-header"
			>
          <Typography className={classes.heading}>Factores de riesgo</Typography>

       		 </AccordionSummary>
			<FormControlLabel
				control={<Checkbox value="remember" color="primary" />}
				label="Remember me"
				/>
		  </Accordion>

            <Button
              type="submit"
              fullWidth
              variant="contained"
              color="primary"
              className={classes.submit}
            >
              Sign In
            </Button>
            <Grid container>
              <Grid item xs>
                <Link href="#" variant="body2">
                  Forgot password?
                </Link>
              </Grid>
              <Grid item>
                <Link href="#" variant="body2">
                  {"Don't have an account? Sign Up"}
                </Link>
              </Grid>
            </Grid>

          </form>
        </div>
      </Grid>
    </Grid>
  );
}
